                    }
                }
                shouldDetailThread.put(threadName, true);
            } else {
                prettyCall.append("JAVAFLAME_DETAILED_TOSTRING");
            }
            prettyCall.append(")");
            long entryTime = System.currentTimeMillis();
            onEnter(threadName, prettyCall.toString(), entryTime);
            return entryTime;
