    public void setScroll(int currentScroll, int totalScroll) {
        if (SHOW_DOT_PAGINATION.get() && mActivePage != 0 && currentScroll == 0) {
            CURRENT_POSITION.set(this, (float) mActivePage);
            return;
        }

        if (mNumPages <= 1) {
            return;
        }

