						aoResults.add(oResult);
					}

					iActualElement++;

					if (iActualElement > iOffset + iLimit)
						break;
				}
			}

			return aoResults;
		} catch (Exception oEx) {
			WasdiLog.debugLog("QueryExecutorCDS.executeAndRetrieve: error " + oEx.toString());
