        String profile = awsProfile == null || awsProfile.equals(AWSProfileHandler.DEFAULT_PROFILE) ? "" :
                String.format("--profile %s ", awsProfile);
        String region = awsRegion == null || awsRegion.equals(InputDialogState.NO_REGION) ? "" :
